import { Produto } from "../Produto";

const ListaProdutos = ({ dataProdutos, cart }) => {
  return (
    <Container>
      {dataProdutos.map((produto, i) => {
        return <Produto key={i * 2} produto={produto} isRemovable />;
      })}
    </Container>
  );
};
export { ListaProdutos };
